import React, { useState } from 'react';
import { CalculatePoints } from './CalculatePoints';
import ShowAdditionalQues from "./ShowAdditionalQues";
import { ClearOptions2 } from "./ClearOptions2";

function StudentExercise2() {
  const handleShowAdditionalQues = () => {
    // Logic to show additional questions
    ShowAdditionalQues();
  };

  const handleCalculatePoints = () => {
    // Logic to calculate points
    CalculatePoints();
  };

  return (
    <div>
      <h1>Student Exercise 2 [13 minutes]</h1>

      <div id="options">
        <p>Does a GPU version of your code already exist?</p>
        <label>
          <input type="radio" name="answer" value="yes" onClick={handleShowAdditionalQues} /> Yes [0 points]
        </label>
        <label>
          <input type="radio" name="answer" value="no" onClick={handleShowAdditionalQues} /> No [4 points]
        </label>
      </div>

      {/* Rest of your code... */}

      <button onClick={handleCalculatePoints}>Submit</button>
      <button onClick={ClearOptions2}>Clear</button>

      <p id="TotalPoints"></p>
      <p id="result"></p>
    </div>
  );
}

export default StudentExercise2;
